--\n-ACHIEVE YOUR DREAMS! SEPTEMBER 29 - OCTOBER 1ST 2016 in\nCOLUMBUS, OHIO\n-What exactly makes this event so unique and amazing? GREAT question.\n\n-The Summit of Greatness was conceived in Lewis Howes’ brain as the ultimate experience for fans of his podcast, book, and work - the quest to become the best version of yourself and serve the world with your greatness. He wanted to bring his followers and his inspirations into the same space to create together. This event is designed to not only teach, inspire, and empower the guests, but to let them come together with people who are on the same journey and lift each other up. \n\n-THAT’S what this Summit offers - come join us! http://summitofgreatness.com/order/ \n\n-----\nYou can follow Lewis at:\nWebsite: http://lewishowes.com/\nFacebook: https://www.facebook.com/lewishowes/\nTwitter: https://twitter.com/LewisHowes\nInstagram: https://www.instagram.com/lewishowes/\nSnapChat: Lewis_Howes\n\nLewis Howes is NY Times Bestselling author, entrepreneur, and former professional Arena League football player. He hosts The School of Greatness, a talk show distributed as a podcast. Learn and hear the stories from various successful people around the world, become inspired, motivated and educated with the SCHOOL OF GREATNESS. lewishowes.com/book","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/q7BJ8JtfAz4/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLAhngEYM97t7iINaJxdDYTKgPAm2w","width":168,"height":94},{"url":"https://i.ytimg.com/vi/q7BJ8JtfAz4/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDnLabegnQrG12RTUil8aP6aVpmsw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/q7BJ8JtfAz4/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDS87g27HxAc3MuIWccdm7JDY7LAQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/q7BJ8JtfAz4/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4q e \n*The question Larry would ask God if he knew he’d get an answer \n*What super power he would choose \n-----\n-ACHIEVE YOUR DREAMS! SEPTEMBER 29 - OCTOBER 1ST 2016 in\nCOLUMBUS, OHIO\n-What exactly makes this event so unique and amazing? GREAT question.\n\n-The Summit of Greatness was conceived in Lewis Howes’ brain as the ultimate experience for fans of his podcast, book, and work - the quest to become the best version of yourself and serve the world with your greatness. He wanted to bring his followers and his inspirations into the same space to create together. This event is designed to not only teach, inspire, and empower the guests, but to let them come together with people who are on the same journey and lift each other up. \n\n-THAT’S what this Summit offers - come join us! http://summitofgreatness.com/order/ \n\n-----\nYou can follow Lewis at:\nWebsite: http://lewishowes.com/\nFacebook: https://www.facebook.com/lewishowes/\nTwitter: https://twitter.com/LewisHowes\nInstagram: https://www.instagram.com/lewishowes/\nSnapChat: Lewis_Howes\n\nLewis Howes is NY Times Bestselling author, entrepreneur, and former professional Arena League football player. He hosts The School of Greatness, a talk show distributed as a podcast. Learn and hear the stories from various successful people around the world, become inspired, motivated and educated with the SCHOOL OF GREATNESS. lewishowes.com/book"},"lengthSeconds":"3753","ownerProfileUrl":"http://www.youtube.com/user/lewishowes","externalChannelId":"UCKsP3v2JeT2hWI_HzkxWiMA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","G
